import React from "react";
import Link from "next/link";

const Index = () => {
  return (
    <>
      <Link href="/tasks/[id]" as={"/tasks/sldkjf"}>
        <a>ShowTask</a>
      </Link>
      <Link href="/create_task">
        <a>CreateTask</a>
      </Link>
    </>
  );
};

export default Index;
